response.activities:
Практический психолог, член ОППЛ, специалист метода ЭОТ.

Провожу терапевтические сессии, консультации по темам:
-эмоциональная зависимость;
-выход из токсичных отношений;
-самоценность;
-помощь созависимым;
-помощь родителям при общении с подростком;
-сепарация;
-тревоги и страх;
-фобии.
